import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>AutoManager is Working!</h1>
      <p>If you can see this, React is working correctly.</p>
      <p>Check the browser console for any errors.</p>
    </div>
  );
}

export default App;
